INSERT INTO `field_data_body` VALUES ('node', 'forum', 0, 1, 1, 'und', 0, '<p>Điều khiển xe vận chuyển khách du lịch, xe vận chuyển hành khách theo hợp đồng bán vé, thu tiền hoặc thực hiện việc xác nhận đặt chỗ cho hành khách đi xe</p>\r\n\r\n<p>600.000 Đ - 800.000 Đ</p>\r\n\r\n<p>Điểm i Khoản 3 Điều 23</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Người điều khiển, người ngồi trên xe mô tô, xe gắn máy (kể cả xe máy điện), các loại xe tương tự xe mô tô và các loại xe tương tự xe gắn máy</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Trừ các xe ưu tiên đang đi làm nhiệm vụ theo quy định</p>\r\n', '', 'full_html');
