INSERT INTO `taxonomy_term_data` VALUES (11, 2, 'Rao Vặt', 'Khu vực rao vặt. Khi post bài tuân thủ nội quy, không được phép spam và đặt link một cách \"Thiếu văn hóa\" cộng đồng. Chú ý: KHÔNG POST LINK TRONG 1 BÀI VIẾT, KHÔNG DÙNG CHỮ MÀU ĐỎ KHI POST BÀI, KHÔNG POST TRÙNG LẶP NỘI DUNG, KHÔNG DÙNG KÝ TỰ ĐẶC BIỆT TRONG TITLE, CÁC BÀI AUTO POST KHÔNG ĐƯỢC CHẤP NHÂN ! VI PHẠM XÓA NICK VÀ DELETE ALL POST!', NULL, 5);
