  `timestamp` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'UNIX timestamp for when the file was added.',
  PRIMARY KEY (`fid`) USING BTREE,
  UNIQUE INDEX `uri`(`uri`) USING BTREE,
  INDEX `uid`(`uid`) USING BTREE,
  INDEX `status`(`status`) USING BTREE,
  INDEX `timestamp`(`timestamp`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 30 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = 'Stores information for uploaded files.' ROW_FORMAT = Compact;

