  INDEX `node_status_type`(`status`, `type`, `nid`) USING BTREE,
  INDEX `node_title_type`(`title`, `type`(4)) USING BTREE,
  INDEX `node_type`(`type`(4)) USING BTREE,
  INDEX `uid`(`uid`) USING BTREE,
  INDEX `tnid`(`tnid`) USING BTREE,
  INDEX `translate`(`translate`) USING BTREE,
  INDEX `language`(`language`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = 'The base table for nodes.' ROW_FORMAT = Compact;

