  `tag` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT 'A tag used to group/sort views in the admin interface',
  `base_table` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT 'What table this view is based on, such as node, user, comment, or term.',
  `human_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT 'A human readable name used to be displayed in the admin interface',
  `core` int(11) NULL DEFAULT 0 COMMENT 'Stores the drupal core version of the view.',
  PRIMARY KEY (`vid`) USING BTREE,
  UNIQUE INDEX `name`(`name`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = 'Stores the general data for a view.' ROW_FORMAT = Compact;

-- ----------------------------
-- Table structure for votingapi_cache
-- ----------------------------
DROP TABLE IF EXISTS `votingapi_cache`;
CREATE TABLE `votingapi_cache`  (
  `vote_cache_id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `entity_type` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT 'node',
  `entity_id` int(10) UNSIGNED NOT NULL DEFAULT 0,
  `value` float NOT NULL DEFAULT 0,
  `value_type` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT 'percent',
  `tag` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT 'vote',
  `function` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '',
  `timestamp` int(10) UNSIGNED NOT NULL DEFAULT 0,
  PRIMARY KEY (`vote_cache_id`) USING BTREE,
  INDEX `content`(`entity_type`, `entity_id`) USING BTREE,
  INDEX `content_function`(`entity_type`, `entity_id`, `function`) USING BTREE,
  INDEX `content_tag_func`(`entity_type`, `entity_id`, `tag`, `function`) USING BTREE,
  INDEX `content_vtype_tag`(`entity_type`, `entity_id`, `value_type`, `tag`) USING BTREE,
  INDEX `content_vtype_tag_func`(`entity_type`, `entity_id`, `value_type`, `tag`, `function`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Table structure for votingapi_vote
-- ----------------------------
DROP TABLE IF EXISTS `votingapi_vote`;
CREATE TABLE `votingapi_vote`  (
  `vote_id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `entity_type` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT 'node',
  `entity_id` int(10) UNSIGNED NOT NULL DEFAULT 0,
  `value` float NOT NULL DEFAULT 0,
  `value_type` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT 'percent',
  `tag` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT 'vote',
  `uid` int(10) UNSIGNED NOT NULL DEFAULT 0,
  `timestamp` int(10) UNSIGNED NOT NULL DEFAULT 0,
  `vote_source` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  PRIMARY KEY (`vote_id`) USING BTREE,
  INDEX `content_uid`(`entity_type`, `entity_id`, `uid`) USING BTREE,
  INDEX `content_uid_2`(`entity_type`, `uid`) USING BTREE,
  INDEX `content_source`(`entity_type`, `entity_id`, `vote_source`) USING BTREE,
  INDEX `content_value_tag`(`entity_type`, `entity_id`, `value_type`, `tag`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Table structure for watchdog
-- ----------------------------
DROP TABLE IF EXISTS `watchdog`;
CREATE TABLE `watchdog`  (
  `wid` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Primary Key: Unique watchdog event ID.',
  `uid` int(11) NOT NULL DEFAULT 0 COMMENT 'The users.uid of the user who triggered the event.',
  `type` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT 'Type of log message, for example \"user\" or \"page not found.\"',
  `message` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'Text of log message to be passed into the t() function.',
  `variables` longblob NOT NULL COMMENT 'Serialized array of variables that match the message string and that is passed into the t() function.',
  `severity` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The severity level of the event; ranges from 0 (Emergency) to 7 (Debug)',
  `link` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT 'Link to view the result of the event.',
  `location` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'URL of the origin of the event.',
  `referer` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT 'URL of referring page.',
  `hostname` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT 'Hostname of the user who triggered the event.',
  `timestamp` int(11) NOT NULL DEFAULT 0 COMMENT 'Unix timestamp of when event occurred.',
  PRIMARY KEY (`wid`) USING BTREE,
  INDEX `type`(`type`) USING BTREE,
  INDEX `uid`(`uid`) USING BTREE,
  INDEX `severity`(`severity`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2148 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = 'Table that contains logs of all system events.' ROW_FORMAT = Compact;

