-- ----------------------------
-- Table structure for webform
-- ----------------------------
DROP TABLE IF EXISTS `webform`;
CREATE TABLE `webform`  (
  `nid` int(10) UNSIGNED NOT NULL COMMENT 'The node identifier of a webform.',
  `next_serial` int(10) UNSIGNED NOT NULL DEFAULT 1 COMMENT 'The serial number to give to the next submission to this webform.',
  `confirmation` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'The confirmation message or URL displayed to the user after submitting a form.',
  `confirmation_format` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'The filter_format.format of the confirmation message.',
  `redirect_url` varchar(2048) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '<confirmation>' COMMENT 'The URL a user is redirected to after submitting a form.',
  `status` tinyint(4) NOT NULL DEFAULT 1 COMMENT 'Boolean value of a webform for open (1) or closed (0).',
  `block` tinyint(4) NOT NULL DEFAULT 0 COMMENT 'Boolean value for whether this form be available as a block.',
  `allow_draft` tinyint(4) NOT NULL DEFAULT 0 COMMENT 'Boolean value for whether submissions to this form be saved as a draft.',
  `auto_save` tinyint(4) NOT NULL DEFAULT 0 COMMENT 'Boolean value for whether submissions to this form should be auto-saved between pages.',
  `submit_notice` tinyint(4) NOT NULL DEFAULT 1 COMMENT 'Boolean value for whether to show or hide the previous submissions notification.',
  `confidential` tinyint(4) NOT NULL DEFAULT 0 COMMENT 'Boolean value for whether to anonymize submissions.',
  `submit_text` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'The title of the submit button on the form.',
  `submit_limit` tinyint(4) NOT NULL DEFAULT -1 COMMENT 'The number of submissions a single user is allowed to submit within an interval. -1 is unlimited.',
  `submit_interval` int(11) NOT NULL DEFAULT -1 COMMENT 'The amount of time in seconds that must pass before a user can submit another submission within the set limit.',
  `total_submit_limit` int(11) NOT NULL DEFAULT -1 COMMENT 'The total number of submissions allowed within an interval. -1 is unlimited.',
  `total_submit_interval` int(11) NOT NULL DEFAULT -1 COMMENT 'The amount of time in seconds that must pass before another submission can be submitted within the set limit.',
  `progressbar_bar` tinyint(4) NOT NULL DEFAULT 0 COMMENT 'Boolean value indicating if the bar should be shown as part of the progress bar.',
  `progressbar_page_number` tinyint(4) NOT NULL DEFAULT 0 COMMENT 'Boolean value indicating if the page number should be shown as part of the progress bar.',
  `progressbar_percent` tinyint(4) NOT NULL DEFAULT 0 COMMENT 'Boolean value indicating if the percentage complete should be shown as part of the progress bar.',
  `progressbar_pagebreak_labels` tinyint(4) NOT NULL DEFAULT 0 COMMENT 'Boolean value indicating if the pagebreak labels should be included as part of the progress bar.',
  `progressbar_include_confirmation` tinyint(4) NOT NULL DEFAULT 0 COMMENT 'Boolean value indicating if the confirmation page should count as a page in the progress bar.',
  `progressbar_label_first` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'Label for the first page of the progress bar.',
  `progressbar_label_confirmation` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'Label for the last page of the progress bar.',
  `preview` tinyint(4) NOT NULL DEFAULT 0 COMMENT 'Boolean value indicating if this form includes a page for previewing the submission.',
  `preview_next_button_label` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'The text for the button that will proceed to the preview page.',
  `preview_prev_button_label` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'The text for the button to go backwards from the preview page.',
  `preview_title` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'The title of the preview page, as used by the progress bar.',
  `preview_message` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'Text shown on the preview page of the form.',
  `preview_message_format` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'The filter_format.format of the preview page message.',
  `preview_excluded_components` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'Comma-separated list of component IDs that should not be included in this form’s confirmation page.',
  PRIMARY KEY (`nid`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = 'Table for storing additional properties for webform nodes.' ROW_FORMAT = Compact;

-- ----------------------------
-- Table structure for webform_component
-- ----------------------------
DROP TABLE IF EXISTS `webform_component`;
CREATE TABLE `webform_component`  (
  `nid` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The node identifier of a webform.',
  `cid` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The identifier for this component within this node, starts at 0 for each node.',
  `pid` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'If this component has a parent fieldset, the cid of that component.',
  `form_key` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'When the form is displayed and processed, this key can be used to reference the results.',
  `name` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'The label for this component.',
  `type` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'The field type of this component (textfield, select, hidden, etc.).',
  `value` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'The default value of the component when displayed to the end-user.',
  `extra` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'Additional information unique to the display or processing of this component.',
  `required` tinyint(4) NOT NULL DEFAULT 0 COMMENT 'Boolean flag for if this component is required.',
  `weight` smallint(6) NOT NULL DEFAULT 0 COMMENT 'Determines the position of this component in the form.',
  PRIMARY KEY (`nid`, `cid`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = 'Stores information about components for webform nodes.' ROW_FORMAT = Compact;

-- ----------------------------
-- Table structure for webform_conditional
-- ----------------------------
DROP TABLE IF EXISTS `webform_conditional`;
CREATE TABLE `webform_conditional`  (
  `nid` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The node identifier of a webform.',
  `rgid` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The rule group identifier for this group of rules.',
  `andor` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'Whether to AND or OR the actions in this group. All actions within the same rgid should have the same andor value.',
  `weight` smallint(6) NOT NULL DEFAULT 0 COMMENT 'Determines the position of this conditional compared to others.',
  PRIMARY KEY (`nid`, `rgid`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = 'Holds information about conditional logic.' ROW_FORMAT = Compact;

-- ----------------------------
-- Table structure for webform_conditional_actions
-- ----------------------------
DROP TABLE IF EXISTS `webform_conditional_actions`;
CREATE TABLE `webform_conditional_actions`  (
  `nid` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The node identifier of a webform.',
  `rgid` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The rule group identifier for this group of rules.',
  `aid` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The rule identifier for this conditional action.',
  `target_type` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'The type of target to be affected. Currently always \"component\". Indicates what type of ID the \"target\" column contains.',
  `target` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'The ID of the target to be affected. Typically a component ID.',
  `invert` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'If inverted, execute when rule(s) are false.',
  `action` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'The action to be performed on the target.',
  `argument` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT 'Optional argument for action.',
  PRIMARY KEY (`nid`, `rgid`, `aid`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = 'Holds information about conditional actions.' ROW_FORMAT = Compact;

-- ----------------------------
-- Table structure for webform_conditional_rules
-- ----------------------------
DROP TABLE IF EXISTS `webform_conditional_rules`;
CREATE TABLE `webform_conditional_rules`  (
  `nid` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The node identifier of a webform.',
  `rgid` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The rule group identifier for this group of rules.',
  `rid` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The rule identifier for this conditional rule.',
  `source_type` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'The type of source on which the conditional is based. Currently always \"component\". Indicates what type of ID the \"source\" column contains.',
  `source` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The component ID being used in this condition.',
  `operator` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'Which operator (equal, contains, starts with, etc.) should be used for this comparison between the source and value?',
  `value` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT 'The value to be compared with source.',
  PRIMARY KEY (`nid`, `rgid`, `rid`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = 'Holds information about conditional logic.' ROW_FORMAT = Compact;

-- ----------------------------
-- Table structure for webform_emails
-- ----------------------------
DROP TABLE IF EXISTS `webform_emails`;
CREATE TABLE `webform_emails`  (
  `nid` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The node identifier of a webform.',
  `eid` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The e-mail identifier for this row’s settings.',
  `email` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT 'The e-mail address that will be sent to upon submission. This may be an e-mail address, the special key \"default\" or a numeric value. If a numeric value is used, the value of a component will be substituted on submission.',
  `subject` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT 'The e-mail subject that will be used. This may be a string, the special key \"default\" or a numeric value. If a numeric value is used, the value of a component will be substituted on submission.',
  `from_name` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT 'The e-mail \"from\" name that will be used. This may be a string, the special key \"default\" or a numeric value. If a numeric value is used, the value of a component will be substituted on submission.',
  `from_address` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT 'The e-mail \"from\" e-mail address that will be used. This may be a string, the special key \"default\" or a numeric value. If a numeric value is used, the value of a component will be substituted on submission.',
  `template` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT 'A template that will be used for the sent e-mail. This may be a string or the special key \"default\", which will use the template provided by the theming layer.',
  `excluded_components` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'A list of components that will not be included in the [submission:values] token. A list of CIDs separated by commas.',
  `html` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'Determines if the e-mail will be sent in an HTML format. Requires Mime Mail module.',
  `attachments` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'Determines if the e-mail will include file attachments. Requires Mime Mail module.',
  `exclude_empty` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'Determines if the e-mail will include component with an empty value.',
  `extra` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'A serialized array of additional options for the e-mail configuration, including value mapping for the TO and FROM addresses for select lists.',
  `status` tinyint(3) UNSIGNED NOT NULL DEFAULT 1 COMMENT 'Whether this email is enabled.',
  PRIMARY KEY (`nid`, `eid`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = 'Holds information regarding e-mails that should be sent...' ROW_FORMAT = Compact;

-- ----------------------------
-- Table structure for webform_last_download
-- ----------------------------
DROP TABLE IF EXISTS `webform_last_download`;
CREATE TABLE `webform_last_download`  (
  `nid` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The node identifier of a webform.',
  `uid` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The user identifier.',
  `sid` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The last downloaded submission number.',
  `requested` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'Timestamp of last download request.',
  PRIMARY KEY (`nid`, `uid`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = 'Stores last submission number per user download.' ROW_FORMAT = Compact;

-- ----------------------------
-- Table structure for webform_roles
-- ----------------------------
DROP TABLE IF EXISTS `webform_roles`;
CREATE TABLE `webform_roles`  (
  `nid` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The node identifier of a webform.',
  `rid` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The role identifier.',
  PRIMARY KEY (`nid`, `rid`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = 'Holds access information regarding which roles are...' ROW_FORMAT = Compact;

-- ----------------------------
-- Table structure for webform_submissions
-- ----------------------------
DROP TABLE IF EXISTS `webform_submissions`;
CREATE TABLE `webform_submissions`  (
  `sid` int(10) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'The unique identifier for this submission.',
  `nid` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The node identifier of a webform.',
  `serial` int(10) UNSIGNED NOT NULL COMMENT 'The serial number of this submission.',
  `uid` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The id of the user that completed this submission.',
  `is_draft` tinyint(4) NOT NULL DEFAULT 0 COMMENT 'Is this a draft of the submission?',
  `highest_valid_page` smallint(6) NOT NULL DEFAULT 0 COMMENT 'For drafts, the highest validated page number.',
  `submitted` int(11) NOT NULL DEFAULT 0 COMMENT 'Timestamp when the form was first saved as draft or submitted.',
  `completed` int(11) NOT NULL DEFAULT 0 COMMENT 'Timestamp when the form was submitted as complete (not draft).',
  `modified` int(11) NOT NULL DEFAULT 0 COMMENT 'Timestamp when the form was last saved (complete or draft).',
  `remote_addr` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'The IP address of the user that submitted the form.',
  PRIMARY KEY (`sid`) USING BTREE,
  UNIQUE INDEX `sid_nid`(`sid`, `nid`) USING BTREE,
  UNIQUE INDEX `nid_serial`(`nid`, `serial`) USING BTREE,
  INDEX `nid_uid_sid`(`nid`, `uid`, `sid`) USING BTREE,
  INDEX `nid_sid`(`nid`, `sid`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = 'Holds general information about submissions outside of...' ROW_FORMAT = Compact;

-- ----------------------------
-- Table structure for webform_submitted_data
-- ----------------------------
DROP TABLE IF EXISTS `webform_submitted_data`;
CREATE TABLE `webform_submitted_data`  (
  `nid` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The node identifier of a webform.',
  `sid` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The unique identifier for this submission.',
  `cid` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The identifier for this component within this node, starts at 0 for each node.',
  `no` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT 'Usually this value is 0, but if a field has multiple values (such as a time or date), it may require multiple rows in the database.',
  `data` mediumtext CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'The submitted value of this field, may be serialized for some components.',
  PRIMARY KEY (`nid`, `sid`, `cid`, `no`) USING BTREE,
  INDEX `nid`(`nid`) USING BTREE,
  INDEX `sid_nid`(`sid`, `nid`) USING BTREE,
  INDEX `data`(`data`(64)) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = 'Stores all submitted field data for webform submissions.' ROW_FORMAT = Compact;

SET FOREIGN_KEY_CHECKS = 1;
